// C:\Users\Administrator\OneDrive\Documente\GitHub\salarizare\modern-backend\frontend\src\components\salaries\SalaryForm.js
import React, { useState, useEffect } from 'react';
import FormInput from '../shared/forms/FormInput';
import Select from '../shared/forms/Select';
import Button from '../shared/buttons/Button';

const SalaryForm = ({ salary, onSubmit, drivers }) => {
   const [formData, setFormData] = useState({
       sofer: '',
       luna: '',
       salariuBaza: 0,
       diurna: 0,
       bonusuri: [],
       deduceri: [],
       status: 'Draft'
   });

   useEffect(() => {
       if (salary) {
           setFormData(salary);
       }
   }, [salary]);

   const handleSubmit = (e) => {
       e.preventDefault();
       onSubmit(formData);
   };

   const addBonus = () => {
       setFormData(prev => ({
           ...prev,
           bonusuri: [...prev.bonusuri, { tip: '', suma: 0 }]
       }));
   };

   const addDeducere = () => {
       setFormData(prev => ({
           ...prev,
           deduceri: [...prev.deduceri, { tip: '', suma: 0 }]
       }));
   };

   return (
       <form onSubmit={handleSubmit} className="space-y-6">
           <Select
               label="Șofer"
               name="sofer"
               value={formData.sofer}
               onChange={(e) => setFormData({...formData, sofer: e.target.value})}
               options={drivers.map(d => ({
                   value: d._id,
                   label: d.nume
               }))}
               required
           />

           <FormInput
               label="Luna"
               type="month"
               name="luna"
               value={formData.luna}
               onChange={(e) => setFormData({...formData, luna: e.target.value})}
               required
           />

           <FormInput
               label="Salariu Bază"
               type="number"
               name="salariuBaza"
               value={formData.salariuBaza}
               onChange={(e) => setFormData({...formData, salariuBaza: e.target.value})}
               required
           />

           <div>
               <h3 className="text-lg font-medium mb-2">Bonusuri</h3>
               {formData.bonusuri.map((bonus, index) => (
                   <div key={index} className="flex gap-4 mb-2">
                       <FormInput
                           label="Tip"
                           value={bonus.tip}
                           onChange={(e) => {
                               const newBonusuri = [...formData.bonusuri];
                               newBonusuri[index].tip = e.target.value;
                               setFormData({...formData, bonusuri: newBonusuri});
                           }}
                       />
                       <FormInput
                           label="Sumă"
                           type="number"
                           value={bonus.suma}
                           onChange={(e) => {
                               const newBonusuri = [...formData.bonusuri];
                               newBonusuri[index].suma = e.target.value;
                               setFormData({...formData, bonusuri: newBonusuri});
                           }}
                       />
                   </div>
               ))}
               <Button type="button" onClick={addBonus}>
                   Adaugă Bonus
               </Button>
           </div>

           <div>
               <h3 className="text-lg font-medium mb-2">Deduceri</h3>
               {formData.deduceri.map((deducere, index) => (
                   <div key={index} className="flex gap-4 mb-2">
                       <FormInput
                           label="Tip"
                           value={deducere.tip}
                           onChange={(e) => {
                               const newDeduceri = [...formData.deduceri];
                               newDeduceri[index].tip = e.target.value;
                               setFormData({...formData, deduceri: newDeduceri});
                           }}
                       />
                       <FormInput
                           label="Sumă"
                           type="number"
                           value={deducere.suma}
                           onChange={(e) => {
                               const newDeduceri = [...formData.deduceri];
                               newDeduceri[index].suma = e.target.value;
                               setFormData({...formData, deduceri: newDeduceri});
                           }}
                       />
                   </div>
               ))}
               <Button type="button" onClick={addDeducere}>
                   Adaugă Deducere
               </Button>
           </div>

           <Button type="submit" variant="primary">
               {salary ? 'Actualizează' : 'Adaugă'}
           </Button>
       </form>
   );
};

export default SalaryForm;
